const _hoisted_7 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Archer</li><li>True Name: Gilgamesh</li><li>Sex: Male</li><li>Sources: Historical Fact, The Epic of Gilgamesh</li><li>Region: West Asia</li><li>Alignment: Chaotic Good</li><li>Height: 140cm</li><li>Weight: 30kg</li></ul><p><strong>Meta</strong></p><ul><li>Character Creators: Nasu Kinoko and Sakurai Hikaru</li><li>Original Character Designer: Takeuchi Takashi</li><li>Character Designer: Tenkuu Sphere</li><li>Character Voice: Endou Aya</li><li>Major Appearances in Main Works: Fate/hollow ataraxia</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">EX</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magical Resistance: [E]</strong></p><p>Nullifies low ranking Magecraft spells.</p><p><strong>Independent Action: [A]</strong></p><p>Gilgamesh possesses a high-ranked Independent Action Skill. But in the case of using a large amount of Magical Energy, backup from his Master becomes necessary.</p><p><strong>Divinity: [B] ([A+])</strong></p><p>Gilgamesh originally had his Divinity at his maximum rank of A+, but the rank has been lowered because said person does not have a favourable impression of the gods.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Beautiful Rosy-Cheeked Boy: [C]</strong></p><p>One\u2019s nature as a pretty boy that attracts people. It works as a magical charm effect towards people, regardless of their gender, but evasion is possible with the Magical Resistance Skill. Even if one does not have Magical Resistance, they can abate it to some extent so long as they maintain a will to resist.</p><p><strong>The Golden Rule: [A]</strong></p><p>Indicates the fortune of how much money flowed around oneself in their life.</p><p>Gilgamesh, who is considered to be someone who has infinite wealth in the Golden Capital, will never be troubled with money throughout his whole life and can live as an extremely rich person.</p><p><strong>Charisma: [A+]</strong></p><p>Gilgamesh, who is said to be the most outstanding King, possesses an extremely high charisma \u2013 as if it is even a charm or a curse \u2013 already since the time of his youth.</p><p><strong>Collector: [EX]</strong></p><p>The talent to obtain items of a superior quality.</p><p>It is the good luck to incessantly procure even rare items, but it must be remembered that it is a Skill Gilgamesh possesses, so there is no benefit for his Master.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="gate-of-babylon-the-treasures-of-the-king" tabindex="-1"><a class="header-anchor" href="#gate-of-babylon-the-treasures-of-the-king" aria-hidden="true">#</a> Gate of Babylon: The Treasures of the King</h1><ul><li>Rank: B+</li><li>Classification: Anti-Personnel Noble Phantasm</li><li>Range: \u2013</li><li>Maximum Number of Targets: \u2013</li></ul><p>A keyblade that is linked to the Golden Capital. It connects to the capital\u2019s dimensional space, with which Gilgamesh will be freely able to take out the tools that are within his treasure house. It goes without saying that the more of the user\u2019s treasures there are, the more powerful this Noble Phantasm becomes. By connecting the space near himself to Babylon with this Noble Phantasm, Gilgamesh can shoot out innumerable \u201COriginals\u201D of Noble Phantasms that come in a variety of forms, such as swords and spears.</p><p>Although the quantity of the contents that can be shot out is lower in comparison to what Gilgamesh in his normal state would have, from the way it seems, Kid Gil is choosing the Noble Phantasms that are to be shot out with the aim of observing his opponents properly in order to \u201Cstrike at their weak points.\u201D</p><h1 id="enkidu-the-chains-of-heaven" tabindex="-1"><a class="header-anchor" href="#enkidu-the-chains-of-heaven" aria-hidden="true">#</a> Enkidu: The Chains of Heaven</h1><ul><li>Rank: ?</li><li>Classification: Anti-Personnel Noble Phantasm</li><li>Range: 1~30</li><li>Maximum Number of Targets: 1 person</li></ul><p>A Noble Phantasm crowned with the name of Gilgamesh\u2019s one and only friend. One of the Noble Phantasms utilized through \u201CThe Treasures of the King\u201D. Countless chains will bind the opponent in a moment upon activation. It causes a Paralysis status effect and sustained damage onto the opponent by means of binding. It is an Anti-Divine armament that was utilized in the legends \u2013 at the time of when the \u201CBull of Heaven\u201D Divine Beast was being suppressed, thus the higher the target\u2019s divinity aptitude, the more its power grows.</p><h1 id="sha-naqba-imuru-the-omniscient-and-omnipotent-star" tabindex="-1"><a class="header-anchor" href="#sha-naqba-imuru-the-omniscient-and-omnipotent-star" aria-hidden="true">#</a> Sha Naqba Imuru: The Omniscient and Omnipotent Star</h1><ul><li>Rank: EX</li><li>Classification: Anti-Personnel Noble Phantasm</li><li>Range: \u2013</li><li>Maximum Number of Targets: 1 person</li></ul><p>Sha Naqba Imuru (He who Saw the Abyss). Hero King Gilgamesh\u2019s mentality, which reaches every corner of the world like the radiance of the stars and sees through all of creation, sublimated into a Noble Phantasm. A Noble Phantasm of the Constantly Invoked-Type. Not to mention an opponent\u2019s True Name and Noble Phantasm(s), it can definitely see even a truth hidden underneath multiple layers without obstruction and with a single glance. Although it is in a state where it seems to be constantly invoked, one can also assume from appearances that some parts of the Noble Phantasm\u2019s ability are being intentionally limited.</p><p>If its True Name is released, it will operate as \u201Cinstructions\u201D for Gilgamesh to guide himself and others with the most optimum tactics according to the situation presented to him, simultaneously increasing the offensive power and defensive power of his whole team near his own position as a result.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><p>First Person Pronoun: boku<br> Second Person Pronoun: anata<br> Third Person Pronouns: kare / kanojo / \u25CB\u25CB-san</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>\u2018His nature is cruel and heartless. A tyrant who does not comply with the people\u2019s opinions and treats only his own standards as absolute\u2019\u2014\u2014\u2014\u2014such disposition does not hold true for Gilgamesh in this form. He, who has materialized with the figure of a boy\u2019s, strongly possesses the mentality from around the time when he was called a wise ruler in the past, and he basically behaves as a polite and modest boy. The women he has a liking for are of a type similar to \u201Cflowers that bloom in the fields.\u201D</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>Gilgamesh might be prone to attaining even a fragment of the truth regarding the demise of human history. Still, he does not speak of anything about it. Rather, he is only watching over the Master\u2019s battles and smiling. It seems he is not reluctant to lend even his support in the likes of combat, but even so, he will merely not talk about anything that concerns the \u201Ctruth\u201D\u2014\u2014\u2014\u2014</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u201CWhat to call me\u2026 That\u2019s right, please casually call me, Gil.\u201D</p><p>\u201CPlease think of me as just a child, and also, please tell me anything you want me to do, ok Master?\u201D</p><p>\u201CNot too simple, nor too showy. Hey, do you think making around this much adjustments is the most different aspect about me?\u201D</p><p>\u201CWouldn\u2019t it be better to do the things that should be done before long?\u201D</p><p>\u201CGrowing up, huh?... Say, I have mixed feelings about that\u2026\u201D</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>Uruk\u2019s Hero King. Mankind\u2019s oldest Hero. The demihuman, demigod King who governed the Sumerian city-state Uruk around the 26th Century BC. Kid Gil is completely the same person as the Heroic Spirit of the same name.</p><p>It is not certain in \u201CFate/Grand Order\u201D whether Kid Gil is truly \u201CGilgamesh\u201D \u2013 the one who materialized with his usual appearance \u2013 who became much younger by eating the wonder drug of rejuvenation, or whether he truly materialized with this figure from a much younger stage of his life since the beginning.</p><h2 id="standard-weapons" tabindex="-1"><a class="header-anchor" href="#standard-weapons" aria-hidden="true">#</a> Standard Weapons</h2><p>Kid Gil shoots magic swords by means of his Noble Phantasm \u201CThe Treasures of the King\u201D; shooting attacks. The quantity of the contents that can be shot out is lower in comparison to what Gilgamesh in his normal state would have. The shooting is done not with the majestic style where both of his arms are usually crossed, but with a relaxed style where he clearly stands still.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Gilgamesh</strong></p><p>Kid Gil has more mixed feelings than usual when it concerns the adult Gilgamesh.</p><p><strong>Magic King Solomon</strong></p><p>There is \u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0\u25A0.</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>He is fundamentally Kid Gil from hollow. There was even a plan for the size of the armour in Gil-kun\u2019s Third Stage Ascension where it matches with the dimensions of his body, but then it appears as if this is much more better for the small child impression, right? Thus, the armour and cloth that are of the same size as the adult Gilgamesh\u2019s are floating by his hips with a mysterious power. There is the impression that when he walks normally in Chaldea, it looks like he is slowly dragging his mantle along. (Tenkuu Sphere)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p>(Lib will add after publish)</p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 66);
